                <p class="blank-line">

      <section class="frame-parent">
        <div class="contributor-info-wrapper">
          <div class="contributor-info">
            <div class="problem-area">
              <div class="solution-area">
                <img
                  class="image-1-1"
                  loading="lazy"
                  alt=""
                  src="image/Image (1).png"

                <div class="author-list-wrapper">
                  <div class="author-list">

              </div>
              <div class="big-image">
                <div class="sub-image">
                  <img
                    class="image-2-1"
                    loading="lazy"
                    alt=""
                    src="image/Image (2).png"
                  />
                </div>
                <div class="collaborators-parent">
                  <div class="collaborators">
                    <div class="issue-details">
                      <div class="resolution">0</div>
                      <div class="issues">Issues</div>
                    </div>
                  </div>
                  <div class="star-counter">
                    <div class="fork-button">
                      <img
                        class="image-3-1"
                        loading="lazy"
                        alt=""
                        src="image/Image (3).png"
                      />

                      <div class="wrapper">
                        <div class="div">5</div>
                      </div>
                    </div>
                    <div class="stars-icon">

                </div>
              </div>
            </div>
            <div class="main-image">
              <img
                class="image-5-1"
                loading="lazy"
                alt=""
                src="image/Image (5).png"
              />
            </div>
